import React, { Component } from "react";

// import Container from 'react-bootsrtap/Container';
// import Row from 'react-bootsrtap/Row';
// import Col from 'react-bootsrtap/Col';

class Ordlista extends Component {
  render() {
    return (
      <React.Fragment>
      <div className="ui accordion">
  <div className="title">
    <i className="dropdown icon"></i>
    What is a cat?
  </div>
  <div className="content">
    <p className="transition hidden">A cat is a type of domesticated animal. Known for its loyalty and faithfulness, it can be found as a welcome guest in many households across the world.</p>
  </div>
  <div className="title">
    <i className="dropdown icon"></i>
    What kinds of dogs are there?
  </div>
  <div className="content">
    <p className="transition hidden">There are many breeds of dogs. Each breed varies in size and temperament. Owners often select a breed of dog that they find to be compatible with their own lifestyle and desires from a companion.</p>
  </div>
  <div className="title">
    <i className="dropdown icon"></i>
    How do you acquire a dog?
  </div>
  <div className="content">
    <p>Three common ways for a prospective owner to acquire a dog is from pet shops, private owners, or shelters.</p>
    <p>A pet shop may be the most convenient way to buy a dog. Buying a dog from a private owner allows you to assess the pedigree and upbringing of your dog before choosing to take it home. Lastly, finding your dog from a shelter, helps give a good home to a dog who may not find one so readily.</p>
  </div>
</div>
</React.Fragment>
    );
  }
}

export default Ordlista;
